from problems.alternating_characters import select_alternatingCharacters
import unittest

class AlternatingCharactersTest(unittest.TestCase):
    def test_give_AAAA_is_3(self):
        string = 'AAAA'
        deletions = select_alternatingCharacters(string)
        self.assertEqual(deletions, 3)
    
    def test_give_ABABBABAAB_is_4(self):
        string = 'ABABBABAAB'
        deletions = select_alternatingCharacters(string)
        self.assertEqual(deletions, 4)
    
    def test_give_BAABAAABAAABBBAABAAAAABABAAAABABBAABBBABBAAAABABBABAAAAABBABAABBBBAAAABBAABABAAAABABABBBABAAABBBBBBB_is_51(self):
        string = 'BAABAAABAAABBBAABAAAAABABAAAABABBAABBBABBAAAABABBABAAAAABBABAABBBBAAAABBAABABAAAABABABBBABAAABBBBBBB'
        deletions = select_alternatingCharacters(string)
        self.assertEqual(deletions, 51)
    
    def test_give__is_660(self):
        string = ''
        deletions = select_alternatingCharacters(string)
        self.assertEqual(deletions, 660)
    
    def test_give__is_50268(self):
        string = ''
        deletions = select_alternatingCharacters(string)
        self.assertEqual(deletions, 50268)
    